Nederland
Familie
84 minuten

geregisseerd door Johan Nijenhuis
met Rachelle Verdel, Annet Malherbe en Porgy Franssen

Tovenaar Kwark vindt in het Heksenbos een ei, waar een klein meisje uit komt. Het is een miniheksje, dat hij Foeksia noemt. Foeksia gaat naar de Heksenschool om toveren te leren. De school wordt geleid door Juf Minuul, die een oogje heeft op Kwark. Foeksia geeft vader Kwark veel kopzorgen, omdat ze nieuwsgierig is naar de mensenwereld. Als Foeksia in het bos jongetje Tommie ziet, wint haar nieuwsgierigheid en zoekt ze Tommie op in de mensenstad. Daar komt ze erachter dat Tommie's oom Bob het Heksenbos wil platgooien om een snelweg aan te leggen. Foeksia zal samen met Tommie het Heksenbos moeten redden. Verfilming van het gelijknamige boek van Paul van Loon.

